import React from 'react';
import { createRoot } from 'react-dom/client';
import App from './App';
import { GameProvider } from './context/GameContext';
import './styles.css';

const container = document.getElementById('root');
const root = createRoot(container);
root.render(
  <GameProvider>
    <App />
  </GameProvider>
);
